import { Navbar } from "react-bootstrap";
import { BrowserRouter, Routes } from "react-router-dom";

import Home from "./page/Home";

export default function App() {
    return (
      <BrowserRouter>
      <Navbar />
       <Routes path="/" element={<Home />} />
      </BrowserRouter>
    );
  }
